-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `trade_id` bigint(20) NOT NULL COMMENT '订单表id',
  `num` int(11) NOT NULL COMMENT '订单数量',
  `product_id` bigint(20) NOT NULL COMMENT '产品id',
  `product_name` varchar(100) NOT NULL COMMENT '产品名称',
  `product_real_price` float(8,2) NOT NULL COMMENT '产品实际销售价格',
  `product_pic_path` varchar(255) NOT NULL COMMENT '产品图片',
  `total_price` float(8,2) NOT NULL COMMENT '总价格',
  `total_real_price` float(8,2) NOT NULL COMMENT '实付',
  `total_discount_price` float(8,2) NOT NULL COMMENT '总的优惠价格',
  `GMT_CREATE` datetime NOT NULL COMMENT '创建时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '修改时间',
  `status` int(4) NOT NULL COMMENT '交易状态  可选值: 1:* TRADE_NO_CREATE_PAY(没有创建支付宝交易) * 2:WAIT_BUYER_PAY(等待买家付款) 3 SELLER_CONSIGNED_PART(卖家部分发货) * WAIT_SELLER_SEND_GOODS(等待卖家发货,即:买家已付款) * WAIT_BUYER_CONFIRM_GOODS(等待买家确认收货,即:卖家已发货) * TRADE_BUYER_SIGNED(买家已签收,货到付款专用) * TRADE_FINISHED(交易成功) * TRA',
  `refund_status` int(4) DEFAULT NULL COMMENT '退款状态。退款状态。可选值 WAIT_SELLER_AGREE(买家已经申请退款，等待卖家同意) WAIT_BUYER_RETURN_GOODS(卖家已经同意退款，等待买家退货) WAIT_SELLER_CONFIRM_GOODS(买家已经退货，等待卖家确认收货) SELLER_REFUSE_BUYER(卖家拒绝退款) CLOSED(退款关闭) SUCCESS(退款成功)',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'SKU id',
  `properties` varchar(255) DEFAULT NULL COMMENT 'sku的销售属性组合字符串(p1:v1;p2:v2)',
  `propertiesName` varchar(255) DEFAULT NULL COMMENT 'sku组合字符串的值',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=900040 DEFAULT CHARSET=utf8;

