  `cid` int(11) NOT NULL COMMENT '产品类目id',
  `cat_name` varchar(50) NOT NULL COMMENT '产品类目名称',
  `status` int(4) NOT NULL COMMENT '产品状态1：销售中2：仓库中',
  `product_num` int(11) NOT NULL COMMENT '产品总数',
  `props_name` mediumtext COMMENT '商品属性名称(p1:p1_name;p2:p2_name)',
  `PROPS_ALIAS` mediumtext COMMENT '属性值名称(p1:v1:v1_name;p1:v2:v2_name;p1:v3:v3_name;p2:v1:v1_name;p2:v2:v2_name)',
  `type` int(4) NOT NULL COMMENT '商品类型 1：普通 2：推荐 3：新品4：热销',
  `distribution_mode` int(4) NOT NULL COMMENT '配送方式1：快递2：自取',
  `is_post` int(4) NOT NULL COMMENT '是否包邮1：是 2：否',
  `express_id` bigint(20) DEFAULT NULL COMMENT '快递模板id',
  `discount_id` bigint(20) DEFAULT NULL COMMENT '优惠id(为空则不享受优惠)',
  `volume` double DEFAULT NULL COMMENT '体积',
  `weight` double DEFAULT NULL COMMENT '重量',
  `enterprise_product_no` varchar(60) DEFAULT NULL COMMENT '商家系统编号',
  `enterprise_id` bigint(20) NOT NULL COMMENT '商家id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of product
-- ----------------------------

-- ----------------------------
-- Table structure for product_prop_imgs
-- ----------------------------
DROP TABLE IF EXISTS `product_prop_imgs`;
CREATE TABLE `product_prop_imgs` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `product_id` bigint(20) NOT NULL COMMENT '产品id',
  `status` int(4) NOT NULL COMMENT '状态1:显示2:屏蔽3:删除',
  `pic_path` varchar(200) NOT NULL COMMENT '图片显示路径',
  `GMT_CREATE` datetime NOT NULL COMMENT '创建时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '修改时间',
  `sort_num` int(11) NOT NULL COMMENT '图片显示的顺序,按值由小到大显示',
  `type` int(11) NOT NULL COMMENT '图片类型1：轮播图2：详细图片3：其他',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=304 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of product_prop_imgs
-- ----------------------------

-- ----------------------------
-- Table structure for product_shop
-- ----------------------------
DROP TABLE IF EXISTS `product_shop`;
CREATE TABLE `product_shop` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `product_id` bigint(20) NOT NULL COMMENT '商品id',
  `shop_id` bigint(20) NOT NULL COMMENT '商铺id',
  `category_id` bigint(20) NOT NULL COMMENT '自定义类id',
  `GMT_CREATE` datetime NOT NULL COMMENT '创建时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '修改时间',
  `status` int(11) NOT NULL COMMENT '状态1：正常2：删除',
  `type` int(11) NOT NULL COMMENT '商品类型 1：普通商品 2：组合商品',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of product_shop
-- ----------------------------

-- ----------------------------
-- Table structure for product_sku
-- ----------------------------
DROP TABLE IF EXISTS `product_sku`;
CREATE TABLE `product_sku` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `product_id` bigint(20) NOT NULL COMMENT '商品id',
  `properties` varchar(255) NOT NULL COMMENT 'sku的销售属性组合字符串(p1:v1;p2:v2)',
  `propertiesName` varchar(255) NOT NULL COMMENT '组合字符串的值',
  `quantity` int(11) NOT NULL COMMENT '数量',
  `price` float(8,2) NOT NULL COMMENT '价格',
  `GMT_CREATE` datetime NOT NULL COMMENT '创建时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '修改时间',
  `status` int(4) DEFAULT NULL COMMENT '状态1：使用中 2：停用',
  `enterprise_product_no` varchar(60) DEFAULT NULL COMMENT '商品在商家自己系统中的编号',
  `volume` double DEFAULT NULL COMMENT '体积',
  `weight` double DEFAULT NULL COMMENT '重量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of product_sku
-- ----------------------------

-- ----------------------------
-- Table structure for refund
-- ----------------------------
DROP TABLE IF EXISTS `refund`;
CREATE TABLE `refund` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `orders_id` bigint(20) NOT NULL COMMENT '订单id',
  `price` float(8,2) NOT NULL COMMENT '退款金额',
  `type` int(4) NOT NULL COMMENT '状态1：退款申请中2：拒绝退款 3：退款完成',
  `enterprise_id` bigint(20) NOT NULL COMMENT '商家id',
  `enterprise_name` varchar(100) NOT NULL COMMENT '商家名称',
  `buyer_id` bigint(20) NOT NULL COMMENT '买家id',
  `GMT_CREATE` datetime NOT NULL COMMENT '创建时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '更新时间',
  `reason` varchar(255) NOT NULL COMMENT '退款理由',
  `refuse_reason` varchar(255) DEFAULT NULL COMMENT '商家拒绝原因',
  `buyer_phone` varchar(20) NOT NULL COMMENT '买家联系电话',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of refund
-- ----------------------------

-- ----------------------------
-- Table structure for region
-- ----------------------------
DROP TABLE IF EXISTS `region`;
CREATE TABLE `region` (
  `CODE` varchar(6) NOT NULL COMMENT '按照国家规则的统一编码来',
  `PARENT_CODE` varchar(20) NOT NULL COMMENT '上一级地区的编码',
  `REGION_NAME` varchar(120) NOT NULL COMMENT '地区名字',
  `REGION_TYPE` int(2) NOT NULL COMMENT '地区类型，0：国家，1： 省份/直辖市，2：市，3：县/区',
  `STATUS` int(1) NOT NULL COMMENT '1、正常 -1、失效',
  `ABBNAME` varchar(120) DEFAULT NULL COMMENT '区域别名',
  `ZIP` varchar(10) DEFAULT NULL COMMENT '邮编',
  PRIMARY KEY (`CODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='地区,邮编号码表';

-- ----------------------------
-- Records of region
-- ----------------------------

-- ----------------------------
-- Table structure for self_delivery_user
-- ----------------------------
DROP TABLE IF EXISTS `self_delivery_user`;
CREATE TABLE `self_delivery_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_name` varchar(500) NOT NULL COMMENT '账号',
  `pass_word` varchar(500) NOT NULL COMMENT '密码',
  `GMT_CREATE` datetime NOT NULL COMMENT '创建时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '修改时间',
  `status` int(11) NOT NULL COMMENT '状态1：正常2：停用',
  `collect_place_id` bigint(20) NOT NULL COMMENT '所属自提点id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1274 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of self_delivery_user
-- ----------------------------

-- ----------------------------
-- Table structure for seller
-- ----------------------------
DROP TABLE IF EXISTS `seller`;
CREATE TABLE `seller` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `GMT_CREATE` datetime NOT NULL COMMENT '注册时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '修改时间',
  `STATUS` int(4) NOT NULL COMMENT '状态: 1 未激活 2 正常 3 锁定 4 冻结 5 注销',
  `REGISTER_NAME` varchar(50) NOT NULL COMMENT '用户名(手机号码)',
  `MOBILE` varchar(11) NOT NULL COMMENT '电话号码',
  `LOGIN_COUNT` int(11) NOT NULL COMMENT '登录总次数',
  `LOGIN_ERROR_COUNT` int(11) DEFAULT NULL COMMENT '登录错误次数',
  `LAST_LOGIN_TIME` datetime DEFAULT NULL COMMENT '最近一次登录时间',
  `LAST_FREEZE_TIME` datetime DEFAULT NULL COMMENT '最近一次冻结时间',
  `LAST_LOCK_TIME` datetime DEFAULT NULL COMMENT '最近一次被锁时间',
  `DESTROY_TIME` datetime DEFAULT NULL COMMENT '注销时间',
  `USER_TYPE` int(4) NOT NULL COMMENT '用户类型  1个人 2企业 默认为1',
  `CHECK_STATUS` int(4) NOT NULL COMMENT '实名审核状态 1 未审核，2审核通过，3审核不通过，4-审核中，0 初始化',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of seller
-- ----------------------------

-- ----------------------------
-- Table structure for shop
-- ----------------------------
DROP TABLE IF EXISTS `shop`;
CREATE TABLE `shop` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `GMT_CREATE` datetime NOT NULL COMMENT '创建时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '修改时间',
  `status` int(4) NOT NULL COMMENT '状态1:正常 2:停止3:删除',
  `sale_id` bigint(20) NOT NULL COMMENT '卖家id',
  `partner_id` bigint(20) NOT NULL COMMENT '合作者平台id',
  `shop_name` varchar(200) NOT NULL COMMENT '店铺名称',
  `access_key` varchar(32) NOT NULL COMMENT '接入者key',
  `secret_key` varchar(64) NOT NULL COMMENT '接入者秘钥',
  `url` varchar(255) NOT NULL COMMENT '访问地址',
  `wx_url` varchar(255) DEFAULT NULL COMMENT '微信获取openId地址',
  `head_pic_url` varchar(255) DEFAULT NULL COMMENT '商铺头像图片',
  `third_url` varchar(255) DEFAULT NULL COMMENT '第三方校验地址',
  `payment_mode` int(4) NOT NULL COMMENT '支付方式1：支付宝支付2：微信支付',
  PRIMARY KEY (`id`),
  UNIQUE KEY `access_key` (`access_key`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of shop
-- ----------------------------

-- ----------------------------
-- Table structure for shop_index
-- ----------------------------
DROP TABLE IF EXISTS `shop_index`;
CREATE TABLE `shop_index` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `pic_urls` varchar(2000) NOT NULL COMMENT '图片url地址以及排序url地址与排序值和商铺id之间用,号隔开，然后每个之间用;隔开.\r\n例如：0/1/0/1473211400641.jpg,1;0/1/0/1473211497188.jpg,2,/product/list?categoryId=3',
  `status` int(4) NOT NULL COMMENT '状态1：正常 2：停止',
  `GMT_CREATE` datetime NOT NULL COMMENT '创建时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '修改时间',
  `type` int(4) NOT NULL COMMENT '类型1：轮播图2：大图3：推荐产品4：热卖产品',
  `shop_id` bigint(20) NOT NULL COMMENT '商铺id',
  `sort_num` int(11) NOT NULL COMMENT '排序',
  `name` varchar(60) DEFAULT NULL COMMENT '名称(针对类型3来动态设置类型名称)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of shop_index
-- ----------------------------

-- ----------------------------
-- Table structure for trade
-- ----------------------------
DROP TABLE IF EXISTS `trade`;
CREATE TABLE `trade` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `trade_no` varchar(20) DEFAULT NULL COMMENT '订单编号',
  `GMT_CREATE` datetime NOT NULL COMMENT '订单生成时间',
  `GMT_MODIFY` datetime NOT NULL COMMENT '订单修改时间',
  `consign_time` datetime DEFAULT NULL COMMENT '卖家发货时间',
  `buyer_pay_time` datetime DEFAULT NULL COMMENT '买家支付时间',
  `end_time` datetime DEFAULT NULL COMMENT '订单结束时间',
  `enterprise_id` bigint(20) NOT NULL COMMENT '商家id',
  `enterprise_name` varchar(100) NOT NULL COMMENT '商家名称',
  `sale_id` bigint(20) NOT NULL COMMENT '卖家id',
  `sale_name` varchar(100) NOT NULL COMMENT '卖家名称',
  `shop_id` bigint(20) NOT NULL COMMENT '商铺id',
  `shop_name` varchar(100) NOT NULL COMMENT '商铺名称',
  `partner_id` bigint(20) NOT NULL COMMENT '合作者平台id',
  `partner_name` varchar(100) NOT NULL COMMENT '合作者平台名称',
  `express_price` float(8,2) NOT NULL COMMENT '快递费用',
  `buyer_id` bigint(20) NOT NULL COMMENT '买家id',
  `buyer_name` varchar(50) NOT NULL COMMENT '收货人姓名',
  `buyer_address` varchar(255) NOT NULL COMMENT '收货人详细地址',
  `buyer_phone` varchar(20) NOT NULL COMMENT '收货人联系电话',
  `status` int(4) NOT NULL COMMENT '交易状态: * TRADE_NO_CREATE_PAY(没有创建支付宝交易) * WAIT_BUYER_PAY(等待买家付款) * SELLER_CONSIGNED_PART(卖家部分发货) * WAIT_SELLER_SEND_GOODS(等待卖家发货,即:买家已付款) * WAIT_BUYER_CONFIRM_GOODS(等待买家确认收货,即:卖家已发货) * TRADE_BUYER_SIGNED(买家已签收,货到付款专用) * TRADE_FINISHED(交易成功) * TRADE_CL',
  `province` varchar(50) DEFAULT NULL COMMENT '买家所在省',
  `city` varchar(50) DEFAULT NULL COMMENT '买家所在市',
  `REGION` varchar(50) DEFAULT NULL COMMENT '区县',
  `trade_desc` mediumtext COMMENT '订单描述：满多少包邮，  a+b商品一共卖50元等',
  `payment_type` int(4) DEFAULT NULL COMMENT '支付类型1:微信2：支付宝3：网银',
  `payment_no` varchar(100) DEFAULT NULL COMMENT '支付编号(支付平台返回)',
  `invoice_type` int(4) DEFAULT NULL COMMENT '发票类型1：电子发票2：纸质发票',
  `invoice_name` varchar(100) DEFAULT NULL COMMENT '发票抬头',
  `is_invoice` int(4) NOT NULL COMMENT '是否需要开发票',
  `discount_price` float(8,2) NOT NULL COMMENT '订单优惠价格',
  `price` float(8,2) NOT NULL COMMENT '订单总的价格',
  `real_price` float(8,2) NOT NULL COMMENT '订单实际支付金额',
  `distribution_mode` int(4) NOT NULL COMMENT '配送方式1:快递2：自取',
  `sale_remarks` varchar(255) DEFAULT NULL COMMENT '卖家备注',
  `buyer_remarks` varchar(255) DEFAULT NULL COMMENT '买家备注',
  `buyer_address_id` bigint(20) NOT NULL COMMENT '买家收货地址id',
  `express_company` varchar(50) DEFAULT NULL COMMENT '快递公司',
  `express_no` varchar(50) DEFAULT NULL COMMENT '快递编号',
  `express_abb` varchar(50) DEFAULT NULL COMMENT '快递公司简称',
  `pick_up_time` varchar(10) DEFAULT NULL COMMENT '买家提货时间',
  `pick_up_no` varchar(20) DEFAULT NULL COMMENT '提货码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=193 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of trade
-- ----------------------------

