-- ----------------------------
DROP TABLE IF EXISTS `trade_no_sequence`;
CREATE TABLE `trade_no_sequence` (
  `trade_no` bigint(20) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

